import React, { Component } from 'react'

import {
  HeaderContainer,
  Header,
  StyledWorkSection
} from './Work.styles'

const Work = props => {
  return (
    <StyledWorkSection>
      <HeaderContainer>
        <Header>And here's some of my work:</Header>
      </HeaderContainer>
    </StyledWorkSection>
  )
}

export default Work
